import React, { Component } from 'react';
import Footer from '../include/footer';
import NextFooter from '../include/next_footer';

class Mail extends Component{
    render(){
        return(
            <div>
                <section className="mail-section">
                    <div className="container">
                        <div className="row">
                            <div className="col-md-6">
                                <div className="part-1">
                                    <p>Slack</p>
                                    <p>First, enter your email.</p>
                                    <p>Just one more mail- a quik confirmation<br/> - before you say good bye to overstuffed inboxes for good</p>
                                </div>
                            </div>
                            <div className="col-md-6">
                                <div className="part-2">
                                  <p>Looking to join an existing workspace?</p>
                                  <button>Find your workspace.</button>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
                <NextFooter/>
                <Footer/>
            </div>
        )
    }
}

export default Mail;
